import React from "react";
import { Route, Switch } from "react-router-dom";

import signUp from "./pages/signUp.js";
import more from "./pages/more.js";
import cart from "./pages/cart.js";
import f from "./pages/f.js";
import m from "./pages/m.js";
import contact from "./pages/contact.js";
import HomePage from "./pages/HomePage";
import FormsPage from "./pages/FormsPage";
import FormsNavPage from "./pages/FormsNavPage";

class Routes extends React.Component {
  render() {
    return (
      <Switch>

        <Route exact path ="/contact"component={contact}/>
        <Route exact path ="/m"component={m}/>
        <Route exact path ="/f"component={f}/>
        <Route exact path ="/signUp"component={signUp}/>
        <Route exact path ="/more"component={more}/>
        <Route exact path ="/cart"component={cart}/>
        <Route exact path="/" component={HomePage} />
        <Route path="/forms/forms" component={FormsPage} />

        <Route exact path="/forms" component={FormsNavPage} />
        <Route
          render={function () {
            return <h1>Not Found</h1>;
          }}
        />
      </Switch>
    );
  }
}

export default Routes;
